import { Spend, Transaction, Utils } from "@bsv/sdk";

const test = { // 9ae1c5e62dd6a416323773fd996a58f19ec0805ce2f038f3be89135e647991e5 - Sensible
    txHex:     "",
    prevTxHex: "",
    inputIdx:  0,
}
// const test = { // 39df56ccea829fc4035b14b8f6aa8228cf7b2baa69c722bd0be7f3106a09bdcd - Non standard
//     txHex: "",
//     prevTxHex: "",
//     inputIdx: 0,
// }
function main() {
    const tx = Transaction.fromHex(test.txHex)
    const prevTx = Transaction.fromHex(test.prevTxHex)

    const input = tx.inputs[test.inputIdx]
    const sourceOutput = prevTx.outputs[input.sourceOutputIndex]
    const interp = new Spend({
        sourceTXID: prevTx.id('hex'),
        sourceOutputIndex: input.sourceOutputIndex,
        sourceSatoshis: sourceOutput.satoshis!,
        lockingScript: sourceOutput.lockingScript,
        transactionVersion: tx.version,
        otherInputs: [],
        outputs: tx.outputs,
        unlockingScript: input.unlockingScript!,
        inputIndex: test.inputIdx,
        inputSequence: input.sequence,
        lockTime: tx.lockTime,
    })
    while(true) {
        // try{
            interp.step()
        // } catch(e) {
        //     break
        // }
        console.log(interp.programCounter, Utils.toHex(interp.stack[interp.stack.length - 1]))
    }
}

// main().catch(console.error);

main();